import fetch from '../lib/fetch';

const generateToken = async () => {
    let res = null;

    try{
        let resp = await fetch.fetchGet('http://localhost:8080/api/auth/generate-jwt');
        res = resp.data;
    } catch {

    }
    return res;
}

const funcs = {
    generateToken
}

export default funcs;
